import React from "react";
import Data from "../../data/line_Chart_Data.json";
import {
  ResponsiveContainer,
  XAxis,
  YAxis,
  CartesianGrid,
  Legend,
  Tooltip,
  Label,
  AreaChart,
  Area,
  PieChart,
  Pie,
} from "recharts";

const PieChartDiagram = () => {
  return (
    <ResponsiveContainer width="100%" aspect={2}>
      <PieChart width={730} height={250}>
        {/* <Pie
          data={Data}
          dataKey="student"
          nameKey="name"
          cx="50%"
          cy="50%"
          outerRadius={50}
          fill="#8884d8"
        /> */}

        <Pie
          dataKey="student"
          isAnimationActive={true}
          cx={200}
          cy={200}
          outerRadius={80}
          fill="#8884d8"
          label
          data={Data}
          nameKey="name"
        />
        <Tooltip itemStyle={{ color: "red" }} />
      </PieChart>
    </ResponsiveContainer>
  );
};

export default PieChartDiagram;
